import axios from 'axios';
import React, { useEffect, useState } from 'react'

const UserDrives = () => {
  const [drives, setDrives] = useState([]);
  const id=localStorage.getItem('userId');
  const sendRequest= async () =>{
    const res= await axios.get(`http://localhost:5000/driveDetails//user/${id}`).catch(err=>console.log(err));
    const data=await res.data;
    return data;

  };
  useEffect(()=>{
    sendRequest().then((data)=>setDrives(data.drives.drives));

  },[]);
  console.log(drives);
  return (
    <div>{ drives && drives.driveDetails&& drives.driveDetails.map((drive,index)=>(<Drive key={index} title={drive.title} description={drive.description} imageURL={drive.image} userName={drive.user.name} form={drive.form}/>))}</div>
  )
}

export default UserDrives
